data.value:
İşletmeye bağlı olarak oda ve katlar buradan eklenir veya düzenlenebilir.


						Önemli

Odalar Hakkında;

'Oda durumu' Dolu veya Ayırtılmış ise, odaya silme veya düzenleme işlemi yapılamaz.


Katlar Hakkında;

Katlara silme veya düzenleme işlemi yapılabilir. Eğer kat numarası silinecek ve kat numarasına bağlı bir oda var ise, öncelikle kat numarasına bağlı odalar sinilip, kat numarasına bağlı oda kalmadığı taktirde de kat numarası silinebilir.
